#include<bits/stdc++.h>

using namespace std;
int num = 200, Size = 1000;
int core_length_l=3000,core_length_r=5000;
int sub_length_l=500,sub_length_r=500;
string base_dir="fa";
vector<int> G[100];
map<int, string> maps;
int din[100], dout[100];
int n, m, root = -1;
string DNA = "AGCT";
vector<string> res;
vector<int> path;
vector<vector<int> > paths;
vector<int> nodes;
vector<string> Stringsplit(string str, const char split) {
    vector<string> res;
    istringstream iss(str);    // 输入流
    string token;            // 接收缓冲区
    while (getline(iss, token, split))    // 以split为分隔符
    {
        res.push_back(token);
    }
    return res;
}
int toNum(char ch[]){
    int res = 0;
    for(int i=0;ch[i];i++){
        res*=10;
        res+=ch[i]-'0';
    }
    return res;
}
int get_random(int l, int r) {
    int impo = l + rand() % (r - l + 1);
    return impo;
}

char random_choice(string s) {
    int pos = get_random(0, s.size() - 1);
    return s[pos];
}

vector<int> random_choice(vector<vector<int>> v) {
    int pos = get_random(0, v.size() - 1);
    return v[pos];
}

void dfs(int t) {
    if (dout[t] == 0) {
        path.push_back(t);
        string s;
        vector<int> p;
        for (auto t: path) {
            p.push_back(t);
            s += maps[t];
        }
        res.push_back(s);
        paths.push_back(p);
        path.pop_back();
        return;
    }
    for (int i = 0; i < G[t].size(); i++) {
        path.push_back(t);
        dfs(G[t][i]);
        path.pop_back();
    }
}

void print_gfa() {
    ofstream out;
    out.open(base_dir+"/graph.gfa");
    for (auto t: maps) {
        out << "S\t" << t.first << "\t" << t.second << endl;
    }
    for (int i = 1; i <= n; i++) {
        for (int j = 0; j < G[i].size(); j++) {
            out << "L\t" << i << "\t+\t" << G[i][j] << "\t+\t0M" << endl;
        }
    }
    out.close();
}

void input() {

    ifstream in;
    in.open("graph.txt");
    in >> n >> m;
    for (int i = 1; i <= n; i++) {
        int num;
        in >> num;
        nodes.push_back(num);
    }
    for (int i = 1; i <= m; i++) {
        int k, v;
        in >> k >> v;
        G[k].push_back(v);
        dout[k]++;
        din[v]++;
    }
}

string get_random_str(int l, int r) {
    int len = get_random(l, r);
    string s = "";
    for (int i = 1; i <= len; i++) {
        s += random_choice(DNA);
    }
    return s;
}

void create_node() {
    for (int i = 0; i < nodes.size(); i++) {
        int nd = nodes[i];
        string s;
        if (din[nd] >= 2 || dout[nd] >= 2) {
            s = get_random_str(core_length_l, core_length_r);
        } else {
            s = get_random_str(sub_length_l, sub_length_r);
        }
        maps[nd] = s;
    }
}

void create_fa() {
    string strs = "";
    vector<int> pp = random_choice(paths);
    for (int i = 0; i < pp.size(); i++) {
        strs += maps[i];
    }
    ofstream file;
    ofstream res;
    file.open(base_dir+"/read" + std::to_string(num) + ".fa");
    res.open(base_dir+"/res" + std::to_string(num) + ".fa");
    for (int i = 0; i < Size; i++) {
        int l = get_random(0, strs.size() - num - 1);
//        cout<<strs.size()<<" "<<l<<endl;
        file << ">read" + std::to_string(i + 1) << endl;
        for(int i=l;i<l+num;i++){
            file<<strs[i];
        }
        int t = l;
        for (int idx = 0; idx < pp.size(); idx++) {
            int plen = maps[pp[idx]].length();
            if (plen > t) {
                res << "begin:node" + std::to_string(pp[idx]) + " index" + std::to_string(t) + " ";
//                cout<<"end "<<i<<" "<<pp[idx];
                break;
            } else {
                t = t - plen;
            }
        }
        t = l + num;
        for (int idx = 0; idx < pp.size(); idx++) {
            int plen = maps[pp[idx]].size();
            if (plen > t) {
                res << "end:node" + std::to_string(pp[idx]) + " index" + std::to_string(t) <<endl;
                break;
            } else {
                t = t - plen;
            }
        }
    }
}

int main(int argc, char * argv[]) {
    if(argc==2){
        num= toNum(argv[1]);
    }
    if(argc==3){
        num = toNum(argv[1]);Size= toNum(argv[2]);
    }
    if(argc==5){
        num = toNum(argv[1]);Size= toNum(argv[2]);
        core_length_l= toNum(argv[3]);core_length_r= toNum(argv[4]);
    }
    if(argc==7){
        num = toNum(argv[1]);Size= toNum(argv[2]);
        core_length_l= toNum(argv[3]);core_length_r= toNum(argv[4]);
        sub_length_l= toNum(argv[5]);sub_length_r= toNum(argv[6]);
    }
    cerr<<"we will make "<<Size<<" reads with length "<<num<<endl;
    cerr<<"the core dna length:"<<core_length_l<<"-"<<core_length_r<<endl;
    cerr<<"the sub dna length:"<<sub_length_l<<"-"<<sub_length_r<<endl;
    srand((unsigned) time(NULL));
    ofstream out;
    out.open(base_dir+"/res.txt");
    input();
    create_node();
    for (int i = 1; i <= n; i++) {
        if (din[i] == 0)root = i;
    }
    dfs(root);
    for (int i = 0; i < res.size(); i++) {
        for (int t: paths[i]) {
            out << ">" << t;
        }
        out << "       ";
        out << res[i] << endl;
    }
    out.close();
    print_gfa();
    create_fa();
}
